expect.extend({
    toHaveNoErros(result) {
        const pass = (result.length == 0);
        if (pass) {
            return {
                message: () => (`expected ${result} to have 0 length`),
                pass: true,
            };
        }
        else {
            console.log(result);
            return {
                message: () => (`Error on lanes test`),
                pass: false,
            };
        }
    },
});
